import React from 'react';
import styled, {css} from 'styled-components';
import Project from "./Project";

const Wrapper = styled.section`
    align-item: start; 
    margin: 5% 0 5% 0;
    padding 0 5% 2% 5%;
`;
const Underline = styled.section`
    border-bottom-color: #cbcbcb;
    border-bottom-width: 1px;
    border-bottom-style: solid;
`;
var stuff = [];
var stuff = [];
function getStuff(myArray){
    for(let [k, v]  of Object.keys(myArray)){
        stuff.push(v)
    }
}

const UnderLineSection = (props) =>(
<div>
    <Wrapper>
        <Underline>
            {getStuff(props.data)}
        {stuff.map((value, index)=>{
            // {if(value.title)? <Title title={value.title}
            return <p>{value}+ " : " + {index}</p>

            })
        }

        </Underline>
    </Wrapper>
    </div>
)

export default UnderLineSection;
